namespace Test
{
    public partial class Form1 : Form
    {
        public Form1()
        {
            InitializeComponent();
            this.Load += Form1_Load;
            listBox1.SelectedIndexChanged += ListBox1_SelectedIndexChanged;
        }

        private void ListBox1_SelectedIndexChanged(object sender, EventArgs e)
        {
           if(listBox1.SelectedItems.Count != 0)
            {
                Person person = (Person)listBox1.SelectedItem;
                Signature model = GetSignature(person);
                string url = "https://localhost:5001/signature";
                webBrowser1.DocumentText = new Client(url).GetSignatureData(model);
            }
        }

        private void Form1_Load(object sender, EventArgs e)
        {
            List<Person> people = new List<Person>() {
                                                        new Person(){FirstName = "Kai", LastName = "Specht", PositionDescription = "Softwareentwicklung"},
                                                        new Person(){FirstName = "Olaf", LastName = "Specht", PositionDescription = "Chef"},
                                                        new Person(){FirstName = "Sabine", LastName = "Specht", PositionDescription = "Chefin"}
                                                       };

            people.ForEach(x => x.ContactData.AddRange(new ContactData[] { new ContactData { Description = "Tel.", Value = "05247 / 1234 5" }, new ContactData() { Description = "E-Mail", Value = (x.FirstName.First() + "." + x.LastName + "@sp.de").ToLower() } }));
            
            people.ToList().ForEach(x => listBox1.Items.Add(x));   
        }
        
        private Signature GetSignature(Person person)
        {
            Signature model = new Signature();
            model.TemplateName = "Specht";
            model.Person = person;
            model.TextBlocks.Add("Header", "Hallo,");
            model.Images.Add("Footer", "");
            return model;
        }
    }
}
